import React, { Component } from "react";
import PropTypes from "prop-types";

export default class Arrows extends Component {
  constructor(props) {
    super(props);
    this.state = {
      click: 0
    };
  }
  WeekBack = () => {
    console.log("clicked!");
  };

  render() {
    return (
      <div>
        <Button
          variant="contained"
          color="primary"
          className="righty"
          endIcon={<ArrowBackIosIcon />}
          onclick={this.WeekBack()}
        ></Button>
      </div>
    );
  }
}
